import React, { useState } from 'react';

const LoginPagePharma = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle login logic here
    console.log("Pharma logged in");
  };

  return (
    <div className="login-container">
      <h2>Pharma Login</h2>
      <p>As a Pharma professional, you can identify new drug candidates for clinical trials and optimize molecular responses.</p>
      
      <form onSubmit={handleSubmit}>
        <label htmlFor="email">Email:</label>
        <input 
          type="email" 
          id="email" 
          value={email} 
          onChange={(e) => setEmail(e.target.value)} 
          required 
        />
        
        <label htmlFor="password">Password:</label>
        <input 
          type="password" 
          id="password" 
          value={password} 
          onChange={(e) => setPassword(e.target.value)} 
          required 
        />
        
        <button type="submit">Login</button>
      </form>

      <div>
        <h3>Pharma-Specific Information:</h3>
        <p>As a Pharma professional, you can:</p>
        <ul>
          <li>Identify drug candidates</li>
          <li>Optimize responses to clinical trials</li>
          <li>Analyze molecular interactions</li>
        </ul>
        <p>Ensure your drug candidates meet the necessary criteria for clinical testing.</p>
      </div>
    </div>
  );
};

export default LoginPagePharma;
